package Quanlinguoidung;

public class nguoidung {
	private String mangd;
	private String hoten;
	private String tentaikh;
	private String matkhau;
	private String gioitinh;
	private String sodt;
	private String manv;
	public nguoidung(String mangd, String hoten, String tentaikh, String matkhau, String gioitinh, String sodt,
			String manv) {
		super();
		this.mangd = mangd;
		this.hoten = hoten;
		this.tentaikh = tentaikh;
		this.matkhau = matkhau;
		this.gioitinh = gioitinh;
		this.sodt = sodt;
		this.manv = manv;
	}
	public nguoidung() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getMangd() {
		return mangd;
	}
	public void setMangd(String mangd) {
		this.mangd = mangd;
	}
	public String getHoten() {
		return hoten;
	}
	public void setHoten(String hoten) {
		this.hoten = hoten;
	}
	public String getTentaikh() {
		return tentaikh;
	}
	public void setTentaikh(String tentaikh) {
		this.tentaikh = tentaikh;
	}
	public String getMatkhau() {
		return matkhau;
	}
	public void setMatkhau(String matkhau) {
		this.matkhau = matkhau;
	}
	public String getGioitinh() {
		return gioitinh;
	}
	public void setGioitinh(String gioitinh) {
		this.gioitinh = gioitinh;
	}
	public String getSodt() {
		return sodt;
	}
	public void setSodt(String sodt) {
		this.sodt = sodt;
	}
	public String getManv() {
		return manv;
	}
	public void setManv(String manv) {
		this.manv = manv;
	}
	
	
}
